import React, { Component } from 'react'

export default class EmergencyContactNameInput extends Component {
  render() {
    return (
      <div>
            <label for="inputZip">Name</label>
            <input type="text" class="form-control" id="Full Name"></input>
      </div>
    )
  }
}
